const profile = document.querySelector(".image");
const title = document.querySelector(".title");
const job = document.querySelector(".job");
const job_dec = document.querySelector(".job_dec");
const prevee = document.querySelector(".preve");
const next = document.querySelector(".next-btn");
const random = document.querySelector(".random");

let item = 0;
function showPerson() {
  const items = detail[item];
  profile.src = items.img;
  title.textContent = items.name;
  job.textContent = items.job;
  job_dec.textContent = items.desc;
}

window.addEventListener("DOMContentLoaded", showPerson());

prevee.addEventListener("click", function () {
  item--;
  if (item < 0) {
    item = detail.length - 1;
  }
  showPerson();
});

next.addEventListener("click", function () {
  item++;
  if (item > detail.length - 1) {
    item = 0;
  }
  showPerson();
});

random.addEventListener("click", function () {
  item = Math.floor(Math.random() * detail.length);
  showPerson();
  return item;
});

const h1 = document.querySelector(".h1");

const click = document.querySelector(".click");

click.addEventListener("click", () => {
  h1.style.color = "blue";
});
